//Creating functional Component
export const Tile = (props) => 
{
    return(
        <div className={this.props.pmark === "" ? 'tile turn_' +this.props.turn: 'tile' + 'checked_'+this.props.pmark } onClick={this.props.clickFn} id={this.props.cid}></div>
        );
}
